const UserInfo = ({ data }) => {
  return <>userInfo:{data}</>;
};

UserInfo.getInitialProps = async ({ ctx }) => {
  const { userInfo } = ctx.session;
  if (userInfo) {
    return { data: userInfo };
  } else {
    return { data: 'Need Login' };
  }
};

export default UserInfo;
